import React  from "react";
import '../components/styles/leftnav.scss'



const Leftnav = (liber) =>{
    return(
        <div className='library'>
            <h1>Library</h1>
            <div className='library-flex'>
                <div className='library-colone'>
                    <img src={liber.cover} alt=""/>
                </div>
            </div>
        </div>
    )
}





export default Leftnav
